import 'bootstrap/dist/css/bootstrap.css';
import './Landing.css';

function LandingPage() {
  return (
    <div className="App">
      
      <header className="App-header">
      <div className="inner-container">
        <input type="text" className="textbox-left" placeholder="Welcome top" />
        <input type="text" className="textbox-right" placeholder="Align Right" />
      </div>
        <p>
          Welcome to <div className = "App-title"> traveleress </div>
        </p>

        <div className="button">Let's explore </div> 
        <div style={{ height: '25px' }}></div> {/* Empty vertical box */}
        <p style={{ fontSize: '20px' }}> or </p>
        <div style={{ height: '20px' }}></div> {/* Empty vertical box */}
        <div className="button">Meet up! </div> 
        
      </header>
    </div>
  );
}

export default LandingPage;
